// Longest Substring Without Repeating Characters

#include <iostream>
#include <string>
#include <map>
using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
    	map<char,short> existMap;
    	int i = 0, maxlen = 0, curlen = 0;
    	while(i < s.length()){
    		if (existMap.find(s[i]) != existMap.end()) {
    			maxlen = max(curlen, maxlen);
                curlen = min(i-existMap[s[i]]-1, curlen); // 与上次出现的位置作差值，若小于当前长度，则说明中间已被其他字符截断，直接+1
    		}
            existMap[s[i]] = i;
            curlen += 1;
    		i++;
    	}
		return max(curlen, maxlen);
    }
};

